import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import {Typography} from "@material-ui/core";
import Container from "@material-ui/core/Container";
import {makeStyles} from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import profilePhoto from "../images/myPhotoBlackWhite.png"

const useStyles = makeStyles((theme) => ({
    sectionWeb: {
        display: 'none',
        [theme.breakpoints.up('md')]: {
            display: 'flex',
        },
    },
    sectionMobile: {
        display: 'flex',
        [theme.breakpoints.up('md')]: {
            display: 'none',
        },
    },
}));

function App() {
    const classes = useStyles();
    return (
        <div>
            <ApplicationBar/>
            <Container className={classes.sectionWeb} style={{border: 'red solid 1px'}}>
                <div id="box1"></div>
                <div id="box2">
                    <div id="text">
                        <Typography variant="h1" noWrap>Hello,</Typography>
                        <Typography variant="h1" noWrap>I'm Latifa</Typography>
                    </div>
                </div>
            </Container>
            <Grid container className={classes.sectionMobile}>
                <Grid item xs={12}>
                    <img src={profilePhoto}/>
                </Grid>
                <Grid item xs={12}>
                    <Typography variant="h1" noWrap>Hello,</Typography>
                    <Typography variant="h1" noWrap>I'm Latifa</Typography>

                </Grid>
            </Grid>
        </div>
    );
}

export default App;


